import React, { Component } from "react";
import BurgerMenue from "./BurgerMenue";

class SideBar extends Component {
  render() {
    return (
      <div className="SideBar">
        <button>
          <i class="glyphicon glyphicon-menu-hamburger" />
          <BurgerMenue />
        </button>
      </div>
    );
  }
}

export default SideBar;
